import React from "react"
import s from "./App.css"
import Elem from "./ElementList"

function App(props) {
  return (
    <div>
      <div>
        <Elem state={props.state}/>
      </div>
      <div>
        <input type="text"/>
        <button onClick={props.add}></button>
      </div>
    </div>
  );
}

export default App;
